import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>00:30:00</h1>
      <p>Hour &nbsp;&nbsp;&nbsp;&nbsp; Minute &nbsp;&nbsp;&nbsp;&nbsp; Seconde</p>
    </div>
  );
}

export default App;
